import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

import Show from './component/Show';

import {netflix,date,time} from './list';

import DateAndTime from './component/DateAndTime';



const map = netflix.map(names => names);


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

  <div>
    <h1 contentEditable >Hello world</h1>
    <DateAndTime  date = {date} time = {time}></DateAndTime>
    <h2>Top Netflix shows</h2>
    <Show keys = {map[0].key} names={map[0].value}></Show>
    <Show keys = {map[1].key} names={map[1].value}></Show>
    <Show keys = {map[2].key} names={map[2].value}></Show>
    <Show keys = {map[3].key} names={map[3].value}></Show>
    <Show keys = {map[4].key} names={map[4].value}></Show>


  </div>
);
